INSERT INTO `#__cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '<ul>\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2014-06-12 19:45:34', '2014-07-08 20:59:16', 0),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class="links">\n    <div class="block-title">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\n    </ul>\n</div>', '2014-06-12 19:45:35', '2014-06-12 19:45:35', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-06-12 19:45:35', '2014-06-12 19:45:35', 1),
(4, 'CMS Promotion', 'cms_promotion', '<div class="promotion">\r\n<div class="over"><em class="fa fa-truck"></em> <a href="#">Free Shipping</a><br /> On all products</div>\r\n<div class="over"><em class="fa fa-money"></em> <a href="#">Money Back</a><br /> Guarantee</div>\r\n<div class="over"><em class="fa fa-gift"></em> <a href="#">Specisl Weekly</a><br /> Offer</div>\r\n</div>', '2014-06-14 02:28:30', '2014-07-02 20:21:08', 1),
(5, 'Connect With Us', 'connect_with_us', '<div class="box about">\r\n<h3 class="title_block"><span>Connect With Us</span></h3>\r\n<p>Sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris.</p>\r\n<ul class="social">\r\n<li><a class="social-facebook" title="Facebook" href="#"> <em class="fa fa-facebook"></em> <span>Facebook</span> </a></li>\r\n<li><a class="social-twitter" title="Twitter" href="#"> <em class="fa fa-twitter"></em> <span>Twitter</span> </a></li>\r\n<li><a class="social-google" title="Google" href="#"> <em class="fa fa-google-plus"></em> <span>Google</span> </a></li>\r\n<li><a class="social-pin" title="Pinterest" href="#"> <em class="fa fa-pinterest"></em> <span>Pinterest</span> </a></li>\r\n<li><a class="social-rss" title="RSS" href="#"> <em class="fa fa-rss"></em> <span>RSS</span> </a></li>\r\n</ul>\r\n</div>', '2014-07-20 19:47:16', '2014-07-20 19:47:16', 1);
